import React, { Component } from "react";
//import logo from "./logo.svg";
import "./App.css";
import logo from "./assets/images/logo_side.png";
import headerimg from "./assets/images/headerSMl.png";
import footerimg from "./assets/images/headerSMl.png"
import {
  Col,
  Row,
  Container,
  Navbar,
  InputGroup,
  FormControl,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class App extends Component {
  render() {
    return (
      <>
        <Navbar bg="light navbar-light">
          <Navbar.Brand href="/">
            <img
              src={logo}
              width="150"
              height="30"
              className="d-inline-block align-top"
              alt="SAVESTANCE"
            />
          </Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <p>
              {(() => {
                switch ("this.state.login") {
                  case true:
                    return (
                      <Navbar.Text>
                        Signed in as: {"NamePlaceHolder"}
                      </Navbar.Text>
                    );
                  default:
                    return <Navbar.Text>Create Account | Sign In</Navbar.Text>;
                }
              })()}
            </p>
          </Navbar.Collapse>
        </Navbar>
                <br/>
        <Container>
          <Row>
            <Col border="success" style={{ backgroundColor: "#D3D3D3" }}>
              <div>
                <br></br>
                <h6>Search Stores</h6>
                <InputGroup size="sm" className="mb-3">
                  <FormControl
                    aria-label="Small"
                    aria-describedby="inputGroup-sizing-sm"
                  />
                </InputGroup>
              </div>
            </Col>
            <Col xs={8}>
              <img src={headerimg} width="100%" alt="decoration"></img>
            </Col>
            <Col style={{ border: "green", backgroundColor: "#D3D3D3" }}>2 of 2</Col>
          </Row>
          <Row>
            <Col> <img src={footerimg} width="100%" alt="footer"></img></Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default App;
